/*****************************************************************************************
* 
*   GbkToUcs2
*
*   Description: gbkucs2
*
*   Input Params: wcstr  - ucs2
*                 gbkstr - gbk
*                 nCount - 
*  
*   Output Params:
*
*   Return Values:wcstrNULLwchar_tgbkstr-1
*
*****************************************************************************************/

int GbkToUcs2( unsigned short *wcstr, const char *gbkstr, unsigned int nCount )
{
	unsigned char* pgbkstr = (unsigned char*)gbkstr; //
    unsigned int i, j, k, l;            //
    unsigned int nLen = 0;				//


	if( gbkstr == NULL )
    {
        return -1;
    }
    
    nLen = strlen( gbkstr );
     
    //wchar_t
    j = 0;
    if( wcstr == NULL )
    {
        for( i = 0; i < nLen; i++ )
        {
            if( gbkstr[i] >= 0x81 )
            {
                i++;
            }
            j++;
        }
        return j;
    }
    
    //ucs2
    for( i = 0; i < nLen && j < nCount; i++ )
    {
        //0x01~0x7F
        if( pgbkstr[i] < 0x80 )
        {
            wcstr[j] = (unsigned short)(pgbkstr[i]);
            j++;
            continue;
        }
        //gbk
        else if( pgbkstr[i] > 0x80 &&  pgbkstr[i] < 0xff )
        {
            k = pgbkstr[i] - 0x81;
            l = pgbkstr[i+1] - 0x40;
            wcstr[j] = GBK2UCS[k][l];
            j++;
            i++;
        }
        else
        {
            wcstr[j] = 0x3f;
            j++;
        }
    }
	return j;
}


