/*****************************************************************************************
* 
*   Ucs2Len
*
*   Description: unicode
*
*   Input Params: wcstr  - ucs2
*  
*   Output Params:
*
*   Return Values:ucs2
*
*****************************************************************************************/
int Ucs2Len( const unsigned short *wcstr )
{
	int i = 0;			//
	while( wcstr[i] != 0 )
	{
		i++;
	}
	return i;
}
